package com.kuaixiu.videoCard.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-08-15 下午03:37:26 * @version: V 1.0 */public class VideoCard extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     * 主键     */    private Long id ;    /**     * 卡密id     */    private String cardId ;    /**     * 卡类型  1周卡  2月卡  3季卡  4半年卡  5年卡     */    private Integer type ;    /**     * 价格     */    private java.math.BigDecimal price ;    /**     * 有效期     */    private String validityTime ;    /**     * 是否已发放  0否  1 是     */    private Integer isUse ;    /**     * 创建时间     */    private java.util.Date createTime ;    /**     * 创建人员工id     */    private String createUserid ;    /**     * 最后一次更新时间     */    private java.util.Date updateTime ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public String getCardId(){        return this.cardId;    }    public void setCardId(String cardId){        this.cardId=cardId;    }    public Integer getType(){        return this.type;    }    public void setType(Integer type){        this.type=type;    }    public java.math.BigDecimal getPrice(){        return this.price;    }    public void setPrice(java.math.BigDecimal price){        this.price=price;    }    public String getValidityTime(){        return this.validityTime;    }    public void setValidityTime(String validityTime){        this.validityTime=validityTime;    }    public Integer getIsUse(){        return this.isUse;    }    public void setIsUse(Integer isUse){        this.isUse=isUse;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    public String getCreateUserid(){        return this.createUserid;    }    public void setCreateUserid(String createUserid){        this.createUserid=createUserid;    }    public java.util.Date getUpdateTime(){        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}